import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircle, faHome } from '@fortawesome/free-solid-svg-icons';

const Navbar = () => {
  return (
    <div className='containerStyle' style={{ alignItems: 'center', backgroundColor: 'white' }}>
      <div style={{ color: 'black', textAlign: 'center', backgroundColor: '#5DADE2', height: '10vh', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <div style={{ textAlign: 'left', flexGrow: 1, paddingLeft: '20px' }}> {/* Container for Account Management and Year */}
          <h1 style={{ margin: 0 }}>Account Management</h1>
        </div>
      </div>

      {/* <hr style={{ width: '100%', height: '2px', backgroundColor: 'black', margin: '20px 0' }} /> Line below "Home" and "Account Management" */}

      <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'space-between', alignItems: 'center', gap: '10px', padding: '20px' }}>
        <div style={{ width: '300px', height: '150px', backgroundColor: 'lightblue', borderRadius: '10px', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
          <button style={{ backgroundColor: 'transparent', border: 'none', fontSize: '18px', fontWeight: 'bold', cursor: 'pointer' }}>
            Box 1
          </button>
        </div>
        <div style={{ width: '300px', height: '150px', backgroundColor: 'lightgreen', borderRadius: '10px', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
          <button style={{ backgroundColor: 'transparent', border: 'none', fontSize: '18px', fontWeight: 'bold', cursor: 'pointer' }}>
            Box 2
          </button>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
